import React from "react";
import './logo.svg';

export default function Header() {
    return (
        <>
            <ul>
                <li>
                    <img src={logo} alt="" srcset="" />
                    <h1>Gyber.org</h1>
                </li>
                <li>
                    <h1>Gyber.org</h1>
                </li>
                <li>
                    <button className="rgbBtn">Private sale</button>
                </li>
            </ul>
        </>
    );
}
